import React from 'react';
import './Form.css';
import text869 from './g6682.png';
import fondo2 from './64857.jpg';

const Form  = () => {
  return (

  <div className=" tc blue " >

    <section>

      <div>
          <h1 className="f2">Listo para empezar a trabajar</h1>
      </div>

      <div className="">

          <form className=" ">

            <div className="flex">

              <div className=" ">
                <label></label>
                  <input
                 //    onChange = {onEmailChange}
                       className=" br2 input-reset ba b--white "
                       type="text"
                       name="email-address"
                       id="email-address"
                  //     placeholder="email@mail.com"
                       required
                  //   value= {onEmailChange.signInEmail}
                  />


              </div>

              <div>
                <label></label>
                  <input
                 //    onChange = {onEmailChange}
                       className="  br2 input-reset ba b--white br2 "
                       type="email"
                       name="email-address"
                       id="email-address"
                       placeholder="email@mail.com"
                       required
                  //   value= {onEmailChange.signInEmail}
                  />

              </div>

            </div>

            <div className="">
              <label></label>

                <input
               //    onChange = {onEmailChange}
                     className=" br2 input-reset ba b--white br2 "
                     type="email"
                     name="email-address"
                     id="email-address"
                     placeholder="email@mail.com"
                     required
                //   value= {onEmailChange.signInEmail}
                />

            </div>

            <div className="w-50">>
              <label></label>

                <input
               //    onChange = {onEmailChange}
                     className=" br2 input-reset ba b--white br2 "
                     type="email"
                     name="email-address"
                     id="email-address"
                     placeholder="email@mail.com"
                     required
                //   value= {onEmailChange.signInEmail}
                />

            </div>

            <div className="w-50">>
              <label></label>

                <input
               //    onChange = {onEmailChange}
                     className=" br2 input-reset ba b--white br2 "
                     type="email"
                     name="email-address"
                     id="email-address"
                     placeholder="email@mail.com"
                     required
                //   value= {onEmailChange.signInEmail}
                />

            </div>

            <div>
                <h1 className="f2">Cuentanos que presupuesto tienes</h1>
            </div>

            <div>
              <label></label>

                <input
               //    onChange = {onEmailChange}
                     className=" br2 input-reset ba b--white br2 "
                     type="email"
                     name="email-address"
                     id="email-address"
                     placeholder="email@mail.com"
                     required
                //   value= {onEmailChange.signInEmail}
                />

            </div>

            <div>
              <label></label>

                <input
               //    onChange = {onEmailChange}
                     className=" br2 input-reset ba b--white br2 "
                     type="email"
                     name="email-address"
                     id="email-address"
                     placeholder="email@mail.com"
                     required
                //   value= {onEmailChange.signInEmail}
                />

            </div>

            <div>
                <h1 className="f2">Cuentanos como te ayudamos</h1>
            </div>

            <div>
              <label></label>

                <input
               //    onChange = {onEmailChange}
                     className=" br2 input-reset ba b--white br2 "
                     type="email"
                     name="email-address"
                     id="email-address"
                     placeholder="email@mail.com"
                     required
                //   value= {onEmailChange.signInEmail}
                />

            </div>

            <div>
              <label></label>
                <input type="submit" value="Submit" />

            </div>

            <div>
                <h1 className="f2">Politicas de privacidad</h1>
            </div>

          </form>

      </div>

    </section>

  </div>




  );


}

export default Form;
